import React from "react";

class Posts extends React.Component {
  constructor(props) {
    super(props);
    this.state = { posts: [], isloading: true };
  }
  async getPosts() {
    let posts = await fetch("/api/posts", {
      method: "GET",
      headers: {
        "x-auth-token":
          "eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJ1c2VyIjp7ImlkIjoiNWY4MmE2MDM0YWE1NjMwOWE4MzI5OGVjIn0sImlhdCI6MTYwMjU3NzQ4NiwiZXhwIjoxNjA2MTc3NDg2fQ.pLZw3DGPHhjDTnvQGWdIFHrV4n_Aa65hkcaLGZreK8I",
      },
    })
      .then((res) => {
        return res.json();
      })
      .then((data) => {
        return data;
      });
  }

  componentDidMount = () => {
    console.log("AAAAAAAAAAAAA");
    const post = this.getPosts();
    this.setState({ post, isloading: false });
  };
  render = () => {
    console.log("BBBBBBB");
    const { posts, loading } = this.state;
    console.log(loading, posts);
    if (loading) {
      return <div></div>;
    } else {
      return posts.map((element) => {
        return <div>{element}</div>;
      });
    }
  };
}

export default Posts;
